export default class LoginForm extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            email: "", 
            password: "", 
        }
    }

    handleChange () {
        this.setState({
            email: "ba3toch@b3ar",
            password: "kharya"
        })
        console.log("handlechange processing");
    }


    render() {
        return (
            <form> 
                <div>
                    <input
                        name="email"
                        type="text"
                        placeholder="email"
                        onChange={() => this.handleChange()}
                        value={this.state.emaul}
                     />
                </div>
                <div>
                    <input
                        name="password"
                        type="password"
                        placeholder="password"
                        onChange={() => this.handleChange()}
                    />
                </div>
                <button type="submit">Submit</button>
            </form> 
        );
    };
};
